import { Inicio } from './components/Inicio';

import Actualizar from './components/Actualizar';
import { Route, Router, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Switch>
        <Route path='/'></Route>
        <Route path='/Actualizar/:id' Component={Actualizar}/>
      </Switch>
    </Router>

  );
}

export default App;
